const logoutUser = async (token)=>{
    const response = await fetch("http://127.0.0.1:8000/api/login/",{
        method: 'POST',
        headers:{
            'Content-Type': 'application/json',
            'Authorization':`Token ${token}`
        },
        body:  {}
    });
    return await response.json();
}

export default logoutUser
